import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

const name = "azeem";
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/280/300";
const img3 = "https://picsum.photos/290/300";
const links = "https://youtube.com/";


const para = {



    color: '#fff444',
    size: '80px',
    textAlign: 'center',
    fontWeight: 'bold',
    textTransform: 'capitalize',
    textShadow: '4px 5px 5px #ff0012',
    margin: '10px',
    fontFamily: '"Bubblegum Sans", cursive'


};

ReactDOM.render(

    <>
        <h1 style={para}>
            hello your name :- {name}
        </h1>
        <div className="b">
            <img src={img1} alt="this is only random image" />
            <img src={img2} alt="this is only random image" />
            <a href={links}>
                <img src={img3} alt="this is only random image" />
            </a>
        </div>

    </>,
    document.getElementById("ro")
);
